import React from 'react';
import { ReactSVG } from 'react-svg';
import stratagyIcon from './icons/straragy.svg';
export default ({ data }) => {
    const getIcon = (iconPath) => {
        switch (iconPath) {
          case './icons/straragy.svg':
            return stratagyIcon;          
          default:
            return null;
        }
    };
    return (
        <>
            <div className="rn-service-area pt-20">
                <div className="container mx-auto">
                    <div class="section-title text-left px-28">
                        <span class="subtitle">Features</span>
                        <h2 class="title">What I Do</h2>
                    </div>
                    <div className="flex flex-wrap items-center px-24">
                        {data.map((item, index) => (
                            <>
                                <div className="w-1/3 px-5 mt-10" key={index}>
                                    <div className="rn-service text-left">
                                        <div className="inner">
                                            <div className="icon">
                                                {item/icon && <ReactSVG src={getIcon(item.icon)} />}
                                            </div>
                                            <div class="content">
                                                <h4 class="title"><a href="#">{item.title}</a></h4>
                                                <p class="description">{item.description}</p>
                                                <a class="read-more-button" href="#"><i class="feather-arrow-right"></i></a>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </>
                        ))}
                    </div>
                </div>
            </div>  
        </>
    )
}
